def binsearch(array, value):
    start = 0
    end = len(array) - 1

    while start <= end:
        mid = (start + end) // 2
        if array[mid] < value:
            start = mid + 1
        elif array[mid] > value:
            end = mid - 1
        else:
            while array[mid - 1] == array[mid]:
                mid -= 1
            return mid + 1  # Per ottenere la posizione togliere il +1

    return -1


